      18 ->
	  d_field_Autenticacao_password(Rest, 0, 0, F@_1, F@_2,
					TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_Autenticacao(Rest, 0, 0, F@_1, F@_2,
